import React from 'react';
import {Switch, Route} from 'react-router-dom';
import Servicios from './paginas/Servicios';


const routes = () =>{
    return(
        <Switch>
            <Route path="/paginas" component={Servicios} exact/>
        </Switch>
    );
}
export default routes;
